import React from "react";
import "../styles/Navbar.css";
import logo from "../images/logo-mmnews.png";

function Navbar() {
  return (
    <div className="navbar">
      <div className="logo">
        <img src={logo} alt="Logo" />
      </div>
      <div className="links">
        <a href="M">
          <img src={link1} alt="Lien 1" />
        </a>
        <a href="M">
          <img src={link2} alt="Lien 2" />
        </a>
        <a href="M">
          <img src={link3} alt="Lien 3" />
        </a>
        <a href="M">
          <img src={link4} alt="Lien 4" />
        </a>
      </div>
    </div>
  );
}

export default Navbar;
